import React, { useState } from "react";
import PropTypes from "prop-types";
import ProjectDetailsModal from "./ProjectDetailsModal";
import Form from "react-bootstrap/Form";
import Stack from "react-bootstrap/Stack";
import Col from "react-bootstrap/Col";
import InputGroup from "react-bootstrap/InputGroup";

function Projects2({ resumeProjects, resumeBasicInfo }) {
  const [deps, setDeps] = useState({});
  const [detailsModalShow, setDetailsModalShow] = useState(false);
  const [filteredProjects, setFilteredProjects] = useState([]);
  const [searchInput, setSearchInput] = useState("");
  const [value, setValue] = useState("All");

  const detailsModalShowHandler = (data) => {
    setDetailsModalShow(true);
    setDeps(data);
  };

  const detailsModalCloseHandler = () => {
    setDetailsModalShow(false);
  };

  const filterProjects = (query) => {
    const filtered = resumeProjects.filter((project) =>
      project.title.toLowerCase().includes(query.toLowerCase())
    );
    if (value !== "All") {
      filtered.sort((a, b) => b[value] - a[value]);
    }
    setFilteredProjects(filtered);
  };

  const handleChange = (e) => {
    const query = e.target.value;
    setSearchInput(query);
    filterProjects(query);
  };

  const handleSelectChange = (e) => {
    const value = e.target.value;
    setValue(value);
  };

  let projects = [];
  let sectionName = "";

  if (resumeProjects && resumeBasicInfo) {
    sectionName = resumeBasicInfo.section_name.projects || "";
    projects = filteredProjects.length ? filteredProjects : resumeProjects;

    projects = projects.map((project) => (
      <div className="div-main" key={project.title}>
        <Col
          xs={4}
          className="wrapper2"
          style={{ cursor: "pointer" }}
          onClick={() => detailsModalShowHandler(project)}
        >
          <span className="portfolio-item d-block">
            <div className="foto">
              <div>
                <img
                  src={project.images[0]}
                  alt="projectImages"
                  height="230"
                  width="368"
                  style={{
                    marginBottom: 0,
                    paddingBottom: 0,
                    position: "relative",
                  }}
                />
                <span className="project-date">{project.startDate}</span>
                <br />
                <p className="project-title-settings mt-3">{project.title}</p>
              </div>
            </div>
          </span>
        </Col>
        <Col xs={8} className="wrapper">
          <h2 className="how-title">CSS3 Skill Progress bar</h2>
          <div className="skill">
            <p>HTML5</p>
            <div className="progress">
              <div
                className="progress-bar progress-bar-striped progress-bar-animated"
                role="progressbar"
                aria-valuenow="75"
                aria-valuemin="0"
                aria-valuemax="100"
                style={{ width: "75%" }}
              ></div>
            </div>
          </div>
          <div className="skill">
            <p>CSS3</p>
            <div className="progress">
              <div
                className="progress-bar progress-bar-striped progress-bar-animated"
                role="progressbar"
                aria-valuenow="75"
                aria-valuemin="0"
                aria-valuemax="100"
                style={{ width: "75%" }}
              ></div>
            </div>
          </div>
          <div className="skill">
            <p>JQUERY</p>
        <div className="progress">
          <div
            className="progress-bar progress-bar-striped progress-bar-animated"
            role="progressbar"
            aria-valuenow="75"
            aria-valuemin="0"
            aria-valuemax="100"
            style={{ width: "75%" }}
          ></div>
        </div>
      </div>
    </Col>
  </div>
));
}

return (
<div>
<Stack>
<div className="background">
<div className="transparentbox">
<section id="portfolio">
<React.Fragment>
<InputGroup>
<Form.Control
type="search"
onChange={handleChange}
placeholder="Search"
aria-label="Search"
aria-describedby="basic-addon1"
value={searchInput}
/>
<InputGroup.Text id="basic-addon1">Filter by:</InputGroup.Text>
<Form.Control
as="select"
onChange={handleSelectChange}
value={value}
>
<option value="All">All</option>
<option value="name">Name</option>
<option value="popularity">Popularity</option>
<option value="recent">Recent</option>
<option value="size">Size</option>
</Form.Control>
</InputGroup>
</React.Fragment>
</section>
</div>
</div>
</Stack>
  <div className="background">
    <div className="transparentbox">
      <section id="portfolio">
        <div className="col-md-12">
          <h1 className="section-title" style={{ color: "black" }}>
            <span>{sectionName}</span>
          </h1>
          <div className="col-md-12 mx-auto">
            <div className="row mx-auto">
              {projects.length ? <div>{projects}</div> : null}
            </div>
          </div>
          <ProjectDetailsModal
            show={detailsModalShow}
            onHide={detailsModalCloseHandler}
            data={deps}
          />
        </div>
      </section>
    </div>
  </div>
</div>
);
}

Projects2.propTypes = {
resumeProjects: PropTypes.array.isRequired,
resumeBasicInfo: PropTypes.object.isRequired,
};

export default Projects2;
